INSERT INTO MST_DTA_EXTN_ATTR(ATTR_ID, KEY_ID, ITM_PROD_KEY_CD, SEQ_NBR, DTA_SRC_SYS, ATTR_CD_ID, ATTR_VAL_TXT, ATTR_VAL_NBR, ATTR_VAL_DT, ATTR_VAL_TS, CRE8_UID, CRE8_TS, LST_UPDT_UID, LST_UPDT_TS) VALUES (1643, 1018109180, 'UPC  ', 0, 4, null, '<p>Cocoa Butter: a natural moisturizer that leaves skin soft and silky, transforming even the roughest, driest areas into buttery soft skin. Rich in Cocoa Mass Polyphenols which help to combat free radical damage- the main culprit of premature aging</p><p>Shea Butter: deeply moisturizers and soothes dry skin while acting as a moisture barrier to keep skin hydrated.</p><p>Coconut Oil: rich in lauric acid, as well as poly and mono saturated fats to hydrate deeply- giving skin a natural glow while helping to improve absorption and counteracting any white, pasty residue</p>', null, null, '2016-03-15 13:31:28.987193', 'y717606             ', '2016-03-15 13:31:28.987193', 'y717606             ', '2016-03-15 13:31:28.987193');
